import com.eviware.soapui.support.XmlHolder
def record2File = context.expand( '${#TestSuite#Record2File}' )
if(record2File.toLowerCase().equals('y'))
{
def path=context.expand( '${projectDir}')
String curStepName = (String)context.getCurrentStep().getLabel()
def testCase = context.getCurrentStep().getTestCase().getLabel()
path=path+"\\results\\"+testCase
File dir = new File(path);
if (!dir.exists())
{
              log.info 'Creating Directory'
              dir.mkdirs();
}
//log.info path 
def fout = new File(path+"\\"+curStepName+".txt",)
def datetime = new  java.text.SimpleDateFormat("yyyy-MM-dd").format(new Date())+" "+new  java.text.SimpleDateFormat("hh:mm:ss.sss").format(new Date())

fout.write("Time Submitted        :             "+datetime+"\r\n")
fout.append("Time Taken           :              "+messageExchange.timeTaken+"ms\r\n")
fout.append("=========================================================================================================================\r\n","UTF-8")
fout.append("                                                                                         REQUEST\r\n\r\n","UTF-8")
fout.append(new String( messageExchange.getRequestContent() ).replace("\n","\r\n"),"UTF-8")
fout.append("\r\n\r\n","UTF-8")
fout.append("=========================================================================================================================\r\n","UTF-8")
fout.append("                                                                                         RESPONSE\r\n\r\n","UTF-8")
fout.append(new String( messageExchange.getResponseContent() ).replace("\n","\r\n"),"UTF-8")
fout.append("\r\n\r\n","UTF-8")
fout.append("=========================================================================================================================\r\n","UTF-8")

/*log.info new String( messageExchange.getRawRequestData() )
log.info new String( messageExchange.getRawResponseData() )

log.info new String( messageExchange.getRequestContent() )
log.info new String( messageExchange.getResponseContent() )*/
